import { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState([]); // Inicializa data como una matriz vacía

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await fetch('http://localhost:5000/members', {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          },
        });

        if (!response.ok) {
          throw new Error('La solicitud no se pudo completar.');
        }

        const moviesData = await response.json(); // Renombra la variable data a moviesData

        setData(moviesData); // Actualiza el estado data con los datos de películas
        console.log(moviesData);
      } catch (error) {
        console.error('Error al obtener las películas:', error);
      }
    }

    fetchData();
  }, []);

  return (
    <div>
      {data.length === 0 ? (
        <p>Loading...</p>
      ) : (
        data.map((member, i) => (
          <p key={i}>{member}</p>
        ))
      )}
    </div>
  );
}

export default App;
